spacegeishA is an intergalactic bossbAbe with a penchant for all things bass-heavy. She’s constantly defying gravity, working as the Label & Agency Director at Street Ritual by day and a DJ night; representing Shanti Planti and of course Street Ritual. spacegeishA tirelessly scours the outer galaxies, curating Street Ritual’s catalogue of 100+ albums that showcase producers from the United States, Australia, Canada, France, Germany and India.

Her refined taste reflects cutting edge, mid-to-high tempo psychedelic bass — specifically halftime, dubstep, drum & bass, glitch-hop, psybass and dark prog. With over a decade of music industry experience under her ray-gun holster, spacegeishA embodies genres from underground black holes to radioactive cosmic rays, establishing a cumulative universe of freaky, hard-hitting wobbles and whomps. Her musical collages reflect the dedicated selecting and skillful sampling of a true celestial being. spacegeishA has abducted crowds at festivals from Lightning In A Bottle and Symbiosis to Enchanted Forest, Serenity Gathering, Solasta, BOOM Festival, Lucidity and Burning Man.

